import Grid from '@material-ui/core/Grid';
import React from 'react';
import {StyleSheet, View} from 'react-native';
import HeaderV from './Header';
import LineChartV from './LineChart';
import NavbarV from './Navbar';
import RadarChartV from './RadarChart';

const Mystyle={
  backgroundColor:{
    backgroundColor:'#eee'
  },
  chartstyle:{
    backgroundColor:'white',
    margin:'10px',
    borderRadius:'5px',
    padding:'10px',
    boxShadow: '2px 2px #ccc'
  }
}

function DashboardV() {
  return (
    <View style={StyleSheet.flatten([Mystyle.backgroundColor])}>

      <HeaderV/>

      <Grid container  >
        <Grid item xs={12} sm={9} md={1}>
        <Grid item xs={12} sm={9} md={3} >
        <NavbarV/>
        </Grid>
        </Grid>

        <Grid item xs={12} sm={9} md={9}>
        <Grid container >
        <Grid item xs={11} sm={9} md={12} style={StyleSheet.flatten([Mystyle.chartstyle])}>
      <LineChartV/>
      </Grid>

      <Grid item xs={11} sm={9} md={12} style={StyleSheet.flatten([Mystyle.chartstyle])}>
       <RadarChartV/>
     </Grid>
     </Grid>



      </Grid>


          </Grid>

</View>


  );
}

export default DashboardV;
